    }
  }
  render()
  {
  return (
    <div className="App">
      <h1>Props !</h1>
      <Student name="anil" email="mohdarsmeh@gmial" ></Student >
      <button onClick={()=>this.setState({name:"arslan"})}>Update </button>
    </div>
  );
}
}

export default App;











